import React from 'react';
import './Tracklist.module.css';
import Track from '../Track/Track';

function Tracklist({ tracks }) {
    return (
        <div className="Tracklist">
            {tracks.map(track => (
                <Track key={track.id} track={track} />
            ))}
        </div>
    );
};

export default Tracklist;
